import {Routes, Route, Outlet} from 'react-router-dom';

import Home from "./routes/home/home.component";

const Navigation = () => {
  return (
    <div>
      <div>I am the navigation bar</div>
      <Outlet/>
    </div>
  );
}

const Shop = () => {
  return(
    <h1>I am the shop page</h1>
  );
}


function App() {
  return (
    <Routes>
      <Route path='/' element={<Home/>}>
      <Route path='shop' element={<Shop/>}/>
      </Route>
    </Routes>
  );
}

export default App;
